        public static List<Restaurant> GetRestaurantsFromSite()
        {
            var uri = $"https://disneyworld.disney.go.com/dining";
            var agentString = "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.132 Safari/537.36";
            
            var client = new Windows.Web.Http.HttpClient();
            client.DefaultRequestHeaders.Accept.ParseAdd("*/*");
            client.DefaultRequestHeaders.AcceptEncoding.ParseAdd("gzip, deflate, br");
            client.DefaultRequestHeaders.Connection.ParseAdd("keep-alive");
            client.DefaultRequestHeaders.AcceptLanguage.ParseAdd("en-us");
            client.DefaultRequestHeaders.UserAgent.ParseAdd(agentString);
            client.DefaultRequestHeaders.Add("Referer", "https://disneyworld.disney.go.com/dining/");
            client.DefaultRequestHeaders.Add("X-Requested-With", "XMLHttpRequest");
            
            var htmlString = string.Empty;

            client.GetBufferAsync(new Uri(uri)).AsTask().ContinueWith(x1 =>
            {
                IBuffer buffer = x1.Result;

                using (DataReader dataReader = DataReader.FromBuffer(buffer))
                {
                    string result = dataReader.ReadString(buffer.Length);
                    if (result != null)
                    {
                        htmlString = result;
                    }
                }
            }).Wait();


            var doc = new HtmlAgilityPack.HtmlDocument();            
            doc.LoadHtml(htmlString);
            var rests = doc.GetElementbyId("disneyPicks-default").ChildNodes.Where(x => x.Name == "li").ToList();

            var ReturnList = new List<Restaurant>(rests.Count);
            var idRegex = new Regex("([0-9]*);entityType=(.*)");


            foreach (var eachRestHtml in rests)
            {
                var serviceType = eachRestHtml.ChildNodes[0].ChildNodes[1].ChildNodes[1].ChildNodes[2].ChildNodes[4].InnerText.Trim();
                if (serviceType == "Quick Service") continue;

                var eachLocation = eachRestHtml.ChildNodes[0].ChildNodes[1].ChildNodes[1].ChildNodes[1].ChildNodes[2].InnerText;
                var eachName = eachRestHtml.ChildNodes.ToArray()[1].ChildNodes.ToArray()[0].Attributes["data-card-title"].Value;
                var eachIdValue = eachRestHtml.ChildNodes.ToArray()[1].Attributes["data-favorite-id"].Value.ToString();
                var ea = idRegex.Match(eachIdValue);


                var eachUrl = string.Empty;
                try
                {
                    eachUrl = eachRestHtml.ChildNodes[0].ChildNodes[3].Attributes["href"].Value;
                }
                catch (Exception ex)
                {
                    // Do nothing.... FUCK IT... Basically, it don't have a URL
                }

                var eachRest = new Restaurant(Convert.ToInt32(ea.Groups[1].Value), eachName)
                {
                    EntityType = ea.Groups[2].Value,
                    Location = eachLocation,
                    Url = eachUrl,
                };
                ReturnList.Add(eachRest);
            }
            return ReturnList;
        }
    }
}
